'2024-02-10 15:43:11.080294'),(21380,'-42px','String','a',7,12,'792',NULL,'21378',NULL,NULL,'2024-02-10 15:43:11.080294'),(21381,'Our Qualifications','String','a',4,12,'794',NULL,'21378',NULL,NULL,'2024-02-10 15:43:11.080294'),(21382,'250px','String','a',2,12,'795',NULL,'21378',NULL,NULL,'2024-02-10 15:43:11.080294'),(21383,'60px','String','a',3,12,'796',NULL,'21378',NULL,NULL,'2024-02-10 15:43:11.080294'),(21384,'text','null','null',1,12,'3',NULL,'21317',NULL,NULL,'2024-02-10 15:43:11.080294'),(21385,'60px','String','a',3,12,'798',NULL,'21384',NULL,NULL,'2024-02-10 15:43:11.080294'),(21386,'446px','String','a',6,12,'798',NULL,'21384',NULL,NULL,'2024-02-10 15:43:11.080294'),(21387,'250px','String','a',2,12,'798',NULL,'21384',NULL,NULL,'2024-02-10 15:43:11.080294'),(21388,'Our Qualifications','String','a',4,12,'801',NULL,'21384',NULL,NULL,'2024-02-10 15:43:11.080294'),(21389,'103.13333129882812px','String','a',7,12,'802',NULL,'21384',NULL,NULL,'2024-02-10 15:43:11.080294'),(21391,'text','null','null',1,12,'3',NULL,'21317',NULL,NULL,'2024-02-10 15:43:11.080294'),(21392,'60px','String','a',3,12,'804',NULL,'21391',NULL,NULL,'2024-02-10 15:43:11.080294'),(21393,'143px','String','a',6,12,'804',NULL,'21391',NULL,NULL,'2024-02-10 15:43:11.080294'),(21394,'Having met the above standards and requirements in Floridas Department of Education, our driver education course has met the highest standards for online teaching, and is approved and accredited by the FL DOE (see our approval here), which allows school districts in the state of Florida, as well as Charter Schools, to use our course for students seeking  credit towards achieving the diploma, as well as satisfying the Florida online course requirement for graduation. Not everyone thinks the same, thats why we encourage everyone who enrolls in our courses to provide us feedback. On every page of all of our courses, students will see a link that allows a student to report a problem or make a suggestion right inside the course. We listen to those problems and suggestions as our way of constantly improving our courses. Along with this continual improvement of our courses we make regular updates to reflect new laws and procedures and to include revised content such as new videos and animations.  Our customer service team understands that no matter where you live, getting a driver\'s license can be a confusing and frustrating process. Our focus is on understanding our customers\' needs and providing fast, helpful answers to their questions. Laws and requirements vary from state to state, and from one year to the next, but we work diligently to maintain an up-to-date understanding of driver education policy so we can be a resource for our valued customers.','String','a',4,12,'804',NULL,'21391',NULL,NULL,'2024-02-10 15:43:11.080294'),(21395,'250px','String','a',2,12,'807',NULL,'21391',NULL,NULL,'2024-02-10 15:43:11.080294'),(21396,'185px','String','a',7,12,'808',NULL,'21391',NULL,NULL,'2024-02-10 15:43:11.080294'),(21397,'250px','String','a',7,13,'245',NULL,'21360',NULL,NULL,'2024-02-10 15:43:11.080294'),(21398,'300px','String','a',7,13,'246',NULL,'21366',NULL,NULL,'2024-02-10 15:43:11.080294'),(21399,'350px','String','a',7,13,'247',NULL,'21372',NULL,NULL,'2024-02-10 15:43:11.080294'),(21400,'400px','String','a',7,13,'248',NULL,'21378',NULL,NULL,'2024-02-10 15:43:11.080294'),(21401,'450px','String','a',7,13,'249',NULL,'21384',NULL,NULL,'2024-02-10 15:43:11.080294'),(21402,'500px','String','a',7,13,'250',NULL,'21391',NULL,NULL,'2024-02-10 15:43:11.080294'),(21403,'h5','String','a',16,13,'251',NULL,'21338',NULL,NULL,'2024-02-10 15:43:11.080294'),(21404,'h6','String','a',16,13,'252',NULL,'21345',NULL,NULL,'2024-02-10 15:43:11.080294'),(21405,'h6','String','a',16,13,'253',NULL,'21360',NULL,NULL,'2024-02-10 15:43:11.080294'),(21407,'h6','String','a',16,13,'255',NULL,'21384',NULL,NULL,'2024-02-10 15:43:11.080294'),(21409,'carddesign','null','null',1,12,'5',NULL,'18066',NULL,NULL,'2024-02-10 15:43:1