,14,'1690986614',NULL,'37191',NULL,'3','2024-02-10 15:43:11.080294'),(37197,'6','null','gird_lg',6,14,'1690986614',NULL,'37191',NULL,'3','2024-02-10 15:43:11.080294'),(37198,'2','null','grid_no',8,14,'1690986614',NULL,'37191',NULL,'3','2024-02-10 15:43:11.080294'),(37199,'2','null','box_serial',5,14,'1690986612',NULL,'37191',NULL,'3','2024-02-10 15:43:11.080294'),(37200,'106px','null','box_height',3,14,'1690986612',NULL,'37191',NULL,'3','2024-02-10 15:43:11.080294'),(37202,'Most dictionaries define the word discernment as a quality that assists an individual to comprehend something.  There is an obvious connection between safe driving habits and discernment.  The level of discernment one possesses may vary based on how someone processes information and by how they choose to react and apply what they learn.  As we consider a few examples, pay close attention to the situation being described and use them to evaluate or even grade your personal driving behavior based on what you discern and how it may affect your decisions.     Situation 1          Most people have busy schedules and juggle many different responsibilities and obligations.  If you regularly find yourself running late or begin to feel strong emotions such as anger or frustration while driving; how may you choose to respond?','String','a',4,12,'1005',NULL,'37201',NULL,NULL,'2024-02-10 15:43:11.080294'),(37207,'files1690986870.webp','String','a',5,12,'1007',NULL,'37206',NULL,NULL,'2024-02-10 15:43:11.080294'),(37208,'textbox','null','component_type',1,12,'2',NULL,'37197',NULL,'3','2024-02-10 15:43:11.080294'),(37209,'Most dictionaries define the word discernment as a quality that assists an individual to comprehend something.  There is an obvious connection between safe driving habits and discernment.  The level of discernment one possesses may vary based on how someone processes information and by how they choose to react and apply what they learn.  As we consider a few examples, pay close attention to the situation being described and use them to evaluate or even grade your personal driving behavior based on what you discern and how it may affect your decisions.     Situation 1          Most people have busy schedules and juggle many different responsibilities and obligations.  If you regularly find yourself running late or begin to feel strong emotions such as anger or frustration while driving; how may you choose to respond?','String','a',4,12,'1009',NULL,'37208',NULL,NULL,'2024-02-10 15:43:11.080294'),(37218,'image','null','component_type',1,12,'2',NULL,'37193',NULL,'3','2024-02-10 15:43:11.080294'),(37219,'files1690987515.jpg','String','a',5,12,'1011',NULL,'37218',NULL,NULL,'2024-02-10 15:43:11.080294'),(37222,'body','null','box_name',1,14,'1690987806',NULL,'21102',NULL,'3','2024-02-10 15:43:11.080294'),(37224,'1','null','box_serial',5,14,'1690987806',NULL,'37223',NULL,'3','2024-02-10 15:43:11.080294'),(37225,'rgba(255,255,255,1)','null','box_color',4,14,'1690987806',NULL,'37223',NULL,'3','2024-02-10 15:43:11.080294'),(37226,'12','null','gird_lg',6,14,'1690987807',NULL,'37223',NULL,'3','2024-02-10 15:43:11.080294'),(37227,'6','null','grid_md',7,14,'1690987807',NULL,'37223',NULL,'3','2024-02-10 15:43:11.080294'),(37228,'1','null','grid_no',8,14,'1690987807',NULL,'37223',NULL,'3','2024-02-10 15:43:11.080294'),(37229,'209px','null','box_height',3,14,'1690987806',NULL,'37223',NULL,'3','2024-02-10 15:43:11.080294'),(37230,'body','null','box_name',1,14,'1690987869',NULL,'21102',NULL,'3','2024-02-10 15:43:11.080294'),(37231,'rgba(255,255,255,1)','null','box_color',4,14,'1690987869',NULL,'37230',NULL,'3','2024-02-10 15:43:11.080294'),(37232,'1','null','box_serial',5,14,'1690987869',NULL,'37230',NULL,'3','2024-02-10 15:43:11.080294'),(37233,'196px','null','box_height',3,14,'1690987869',NULL,'37230',NULL,'3','2024-02-10 15:43:11.080294'),(37234,'6','null','grid_md',7,14,'1690987870',NULL,'37230',NULL,'3','2024-02-10 15:43:11.080294'),(37235,'1','null','grid_no',8,14,'1690987870',NULL,'37230',NULL,'3','2024-02-10 15:43:11.080294'),(37236,'12','null','gird_lg',6,14,'1690987870',NULL,'37230',NULL,'3','2024-02-10 15:43:11.080294'),(37237,'text','null','component_type',1,12,'1',NULL,'37236',NULL,'3','2024-02-10 15:43:11.080294'),(37238,'Our Goal','String','a',4,12,'1013',NULL,'37237',NULL,NULL,'2024-02-10 15:43:11.080294'),(37239,'textbox','null','component_type',1,12,'1',NULL,'37236',NULL,'3','2024-02-10 15:43:11.080294'),(37240,'Our goal at National Highway Safety Administration is to give our students a solid foundation of driving knowledge and skills that make safe drivers. Through the use of videos, animations, dynamic quizzes, interactive games and storytelling, we help students remain engaged in our courses as they become safe, responsible and confident drivers.','String','a',4,12,'1015',NULL,'37239',NULL,NULL,'2024-02-10 15:43:11.080294'),(37241,'textbox','null','component_type',1,12,'1',NULL,'37236',NULL,'3','2024-02-10 15:43:11.080294'),(37242,'Our Customer Service Excellence Unlike other online only programs, our customer service staff, based in the United States, is here for you 7 days a week, from 8AM to midnight EST. You can reach a live person by phone, chat or email. Yes, youll get a live human to help you whenever you have a question or a problem.','String','a',4,12,'1017',NULL,'37241',NULL,NULL,'2024-02-10 15:43:11.080294'),(37244,'text','null','component_type',1,12,'1',NULL,'37236',NULL,'3','2024-02-10 15:43:11.080294'),(37245,'Our Educational Excellence','String','a',4,12,'1019',NULL,'37244',NULL,NULL,'2024-02-10 15:43:11.080294'),(37246,'textbox','null','component_type',1,12,'1',NULL,'37236',NULL,'3','2024-02-10 15:43:11.080294'),(37247,'Having met the above standards and requirements in Floridas Department of Education, our driver education course has met the highest standards for online teaching, and is approved and accredited by the FL DOE (see our approval here), which allows school districts in the state of Florida, as well as Charter Schools, to use our course for students seeking  credit towards achieving the diploma, as well as satisfying the Florida online course requirement for graduation.  We hope meeting this standard will give any parent the peace of mind that their child is receiving the very best in driver education, and as a result, can take comfort in knowing that their teenagers are learning in the very best way.','String','a',4,12,'1021',NULL,'37246',NULL,NULL,'2024-02-10 15:43:11.080294'),(37248,'text','null','component_type',1,12,'1',NULL,'37236',NULL,'3','2024-02-10 15:43:11.080294'),(37249,'Our Promise of Excellent Service and Constant Improvement','String','a',4,12,'1023',NULL,'37248',NULL,NULL,'2024-02-10 15:43:11.080294'),(37250,'textbox','null','component_type',1,12,'1',NULL,'37236',NULL,'3','2024-02-10 15:43:11.080294'),(37251,'Not everyone thinks the same, thats why we encourage everyone who enrolls in our courses to provide us feedback. On every page of all of our courses, students will see a link that allows a student to report a problem or make a suggestion right inside the course. We listen to those problems and suggestions as our way of constantly improving our courses. Along with this continual improvement of our courses we make regular updates to reflect new laws and procedures and to include revised content such as new videos and animations.  Our customer service team understands that no matter where you live, getting a driver\'s license can be a confusing and frustrating process. Our focus is on understanding our customers\' needs and providing fast, helpful answers to their questions. Laws and requirements vary from state to state, and from one year to the next, but we work diligently to maintain an up-to-date understanding of driver education policy so we can be a resource for our valued customers.','String','a',4,12,'1025',NULL,'37250',NULL,NULL,'2024-02-10 15:43:11.080294'),(37252,'50px 0px 0px 0px','null','component',4,13,'1690988247'