l','notification_date',2,35,'1694092204',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44541,'false','null','notification_flag',4,35,'1694092204',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44542,'2','null','notification_userid',3,35,'1694092204',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44543,'2023/09/07 7:10 PM','null','notification_date',2,35,'1694092204',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44544,'false','null','notification_flag',4,35,'1694092204',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44545,'2023/09/07 7:10 PM','null','notification_date',2,35,'1694092208',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44546,'2','null','notification_userid',3,35,'1694092208',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44547,'2023/09/07 7:10 PM','null','notification_date',2,35,'1694092208',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44548,'2','null','notification_userid',3,35,'1694092208',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44549,'false','null','notification_flag',4,35,'1694092208',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44550,'false','null','notification_flag',4,35,'1694092208',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44551,'8 Week ','null','course_length',3,18,'1694098652',NULL,'123',NULL,'','2024-02-10 15:43:11.080294'),(44552,'Texas Drivers Education (Parent Taught) With DPS Test All Detials ','null','course_info _dtl',2,18,'1694098652',NULL,'123',NULL,'','2024-02-10 15:43:11.080294'),(44553,'54','null','course_discount_price',5,18,'1694098652',NULL,'123',NULL,'','2024-02-10 15:43:11.080294'),(44554,'95','null','course_previous_price',6,18,'1694098652',NULL,'123',NULL,'','2024-02-10 15:43:11.080294'),(44555,'Texas Drivers Education (Parent Taught) With DPS Test','null','course_name',1,18,'1694098652',NULL,'123',NULL,'','2024-02-10 15:43:11.080294'),(44556,'44555','null','course_id',4,18,'1694098652',NULL,'123',NULL,'','2024-02-10 15:43:11.080294'),(44558,'Yes. This course is approved by the Texas Department of Licensing and Regulation. - Course provider #131','null','courses_faq_answer',2,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44559,'Is this course state approved?','null','Courses_faq_question',1,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44560,'','null','courses_faq_icon_url',3,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44561,'Are there any other hidden fees?','null','Courses_faq_question',1,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44562,'We charge NO additional fees for our course. However, you will be required to purchase a Request for Parent Taught Driver Education Instructor Designation Service Application from the Texas Department of Licensing and Regulation (TDLR). TDLR charges $20 for this application, which must be purchased before the Parent-Taught Program Guide will be sent to the qualifying parent instructor. Click here to view TDLR\'s instructions for parents.  You can click the link above to be redirected to TDLR\'s website. We also provide a link to purchase the application from within our course. In either case, the $20 is not paid to us and no online course provider is authorized to provide this document - you must obtain this from TDLR and your payment goes directly to this government agency. Among other things, this guide contains official state forms and training logs that will need to be filled out while administering the Parent Taught program.  In addition, the Department of Public Safety (DPS) charges a fee before issuing a learner permit and driver\'s license. Click here to view detailed fee information on the DPS website. As with the designation service application mentioned above, these fees cannot be bundled into the course price, they must be paid directly to DPS at the time the license application is submitted.','null','courses_faq_answer',2,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44563,'','null','courses_faq_icon_url',3,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44564,'How old do I have to be to take this course?','null','Courses_faq_question',1,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44565,'','null','courses_faq_icon_url',3,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44566,'You must be at least 14 years old to begin this course and under the age of 18.','null','courses_faq_answer',2,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44567,'This course is 32 hours long and is the shortest course allowed by law. Texas law requires that all approved Driver Ed courses be a minimum of 32 hours in length.','null','courses_faq_answer',2,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44568,'How long is this course?','null','Courses_faq_question',1,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44569,'','null','courses_faq_icon_url',3,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44570,'Who can be an instructor for this course?','null','Courses_faq_question',1,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44571,'The following persons may instruct the Parent Taught program:  Parent Stepparent Grandparent Step-grandparent Foster Parent Legal guardian Additionally, a parent, legal guardian, or a judge of a court with jurisdiction over the student can designate a person to instruct the course who meet the following requirements:  Is at least 25 years old; Does not charge a fee for conducting the course; and Has at least seven years of driving experience','null','courses_faq_answer',2,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44572,'','null','courses_faq_icon_url',3,31,'1694099164',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44573,'What could disqualify one as a Parent-Taught instructor?','null','Courses_faq_question',1,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44574,'The following conditions prevent a person from serving as an instructor:  Convicted of Driving While Intoxicated (DWI) in the past seven years. Criminal negligent homicide, even probated. Six or more points on your driving record. Your license has been suspended, forfeited, or revoked in the last three years. For more details, please click here to see the information provided by TDLR regarding parent instructor requirements.','null','courses_faq_answer',2,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44575,'','null','courses_faq_icon_url',3,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44576,'How do I receive my Certificate of Completion?','null','Courses_faq_question',1,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44577,'Its easy! You can instantly download your certificates. Thus there are not shipping and handling charges, and no waiting for the certificate to arrive.','null','courses_faq_answer',2,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44578,'','null','courses_faq_icon_url',3,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44579,'How can I apply for a Hardship License?','null','Courses_faq_question',1,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44580,'You can apply for a Hardship License if you are at least 15 years of age and hold a learner license. You must have completed a 32-hour teen drivers ed course, like our Parent-Taught course, and the required 44 hours of behind-the-wheel training. You will also need to take the Impact Texas Drivers video course. Once you have completed all your drivers education, you can fill out a DL-77 form. Read the instructions on the form carefully to see what situations qualify you to receive a hardship license.','null','courses_faq_answer',2,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44581,'','null','courses_faq_icon_url',3,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44582,'What is required to get a Price-Match?','null','Courses_faq_question',1,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44583,'','null','courses_faq_icon_url',3,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44584,'Found this same course from another authorized provider? We\'ll match the price, plus give you an additional 25% off! Just send an email to info@usnhsa.com, or contact us via our website chat and provide a link to the webpage where we can find the course advertised at a lower price. Once confirmed, we\'ll provide instructions on how to buy our course at the discounted price. To obtain the additional 25% discount: the course must have the same key features that are included with our course. These features include the ability to access the course online from any device, as well as the inclusion of downloadable DE-964 certificates. Downloadable versions of the entire Parent-Taught course in a printable or digital format would not be eligible for the additional 25% discount.','null','courses_faq_answer',2,31,'1694099301',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44585,'false','null','notification_flag',4,35,'1694099517',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44586,'2023/09/07 9:11 PM','null','notification_date',2,35,'1694099517',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44587,'2','null','notification_userid',3,35,'1694099517',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44588,'2023/09/07 9:11 PM','null','notification_date',2,35,'1694099517',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44589,'false','null','notification_flag',4,35,'1694099517',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44590,'2','null','notification_userid',3,35,'1694099517',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(44591,'1','null','course_slno',3,19,'1694099697',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(44592,'