'1694351140',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46447,'2023/09/10 7:06 PM','null','notification_date',2,35,'1694351171',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46448,'2','null','notification_userid',3,35,'1694351171',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46449,'false','null','notification_flag',4,35,'1694351171',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46450,'2023/09/10 7:06 PM','null','notification_date',2,35,'1694351171',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46451,'2','null','notification_userid',3,35,'1694351171',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46452,'false','null','notification_flag',4,35,'1694351171',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46453,'<p><strong>STATE-APPROVED PARENT TAUGHT DRIVERS ED (PTDE) + DPS PERMIT TEST</strong></p>\n<p>All first-time drivers in Texas under the age of 18 are required to complete a state-approved 32-Hour Driver Education Course to apply for a Texas Learner Permit and Driver License. Our course is state-approved and can be taken 100% online without any hassles.</p>\n<p><strong>ABOUT THIS COURSE:</strong></p>\n<ul>\n<li>This course has been fully approved by the Texas Department of Licensing and Regulation.</li>\n<li>This course includes the DPS Permit Test so that you can skip the test at the DPS. We give you an unlimited number of attempts to pass the test.</li>\n<li>This course is 100% online and can be completed from your mobile device or computer. There is no need to download additional software or mobile apps.</li>\n<li>We provide a 100% money-back guarantee. If you request a refund within 30 days of purchase and prior to receiving your Texas Driver Education Certificate (DE-964), we will refund your money, no questions asked.<br>You can sign-in and sign-out whenever you want and we track your progress, so that when you return you can start where you left off.</li>\n<li>All certificates are instantly downloadable. There is no need to pay or wait for certificates to be shipped.<br>Includes the required 14-hour and 30-hour driving logs at no additional cost</li>\n</ul>\n<p><br><strong>THINGS YOU SHOULD KNOW:</strong></p>\n<ul>\n<li>This is the Parent Taught Course (PTDE). A qualified parent or legal guardian is required to serve as the instructor of the behind-the-wheel portion of the course.</li>\n<li>You must be between the ages of 14 and 17 years old to take this course.</li>\n<li>You must be at least 15 years old before you can visit your local DPS and apply for your Learner Permit.</li>\n<li>After completing Module 1 of this course, you can take your DPS Exam for your Learner Permit right from our course and you will be eligible to apply for your Learner Permit.</li>\n<li>You can be eligible to apply for your Texas Driver License when you turn 16 and have held a learner permit for at least 6 months. Please see the following section for more details on what is required.</li>\n</ul>\n<p><br><strong>HOW TO GET YOUR DRIVER LICENSE:</strong></p>\n<ul>\n<li>Sign up for our Parent Taught Course today.</li>\n<li>Complete Module 1 (6 hours) of the course (100% online) and download your DE-964 for Learner License.</li>\n<li>Go to your local DPS office and get your Learner License.</li>\n<li>Begin your 14 Instruction and Observation hours with your parent instructor (detailed instructions provided in the course)Complete Modules 2-12 of the course (100% online) and download your DE-964 for Driver License.</li>\n<li>Complete your 30 hours of Behind-The-Wheel Practice.</li>\n<li>Return to the DPS and get your Driver License.</li>\n</ul>\n<p><br><strong>FUN TO WATCH&ndash;EASY TO LEARN</strong></p>\n<p>Our Texas Driver Education Course is designed to help you get your Texas Learner Permit fast and easy. By combining easy-to-learn text lessons with engaging animations, you&rsquo;ll be amazed at how quickly you&rsquo;ll comprehend our course material. Our course is also divided into concise one-subject chapters so you&rsquo;re able to concentrate on learning one subject at a time.</p>\n<p><strong>- TDLR Approved Parent Taught Course Provider #131</strong></p>','null','course_features',1,30,'1694354294',NULL,'44555',NULL,'','2024-02-10 15:43:11.080294'),(46454,'2023/09/10 8:31 PM','null','notification_date',2,35,'1694356296',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46455,'2','null','notification_userid',3,35,'1694356296',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46456,'false','null','notification_flag',4,35,'1694356296',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46457,'2023/09/10 8:31 PM','null','notification_date',2,35,'1694356296',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46458,'false','null','notification_flag',4,35,'1694356296',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46459,'2','null','notification_userid',3,35,'1694356296',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46628,'2','null','notification_userid',3,35,'1694359691',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46629,'2023/09/10 9:28 PM','null','notification_date',2,35,'1694359691',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46630,'2023/09/10 9:28 PM','null','notification_date',2,35,'1694359691',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46631,'2','null','notification_userid',3,35,'1694359691',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46632,'false','null','notification_flag',4,35,'1694359691',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46633,'false','null','notification_flag',4,35,'1694359691',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46634,'2023/09/10 9:37 PM','null','notification_date',2,35,'1694360241',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46635,'2','null','notification_userid',3,35,'1694360241',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46636,'false','null','notification_flag',4,35,'1694360241',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(46637,'2023/09/10 9:37 PM','null','notification_date',2,35,'16943