,NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(47413,'2023/09/12 4:30 PM','null','notification_date',2,35,'1694514123',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(47414,'2','null','notification_userid',3,35,'1694514123',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(47415,'false','null','notification_flag',4,35,'1694514123',NULL,'41',NULL,'2','2024-02-10 15:43:11.080294'),(47509,'','null','image_url',3,20,'1694538978',NULL,'44594',NULL,'','2024-02-10 15:43:11.080294'),(47510,'<p><span style=\"font-size: 18pt;\"><strong>ABOUT THIS COURSE</strong></span></p>\n<p><span style=\"font-size: 18pt;\"><strong>Course Curriculum:</strong></span></p>\n<p>This course is broken down into 12 modules. Each module contains various related subjects. Throughout the course you will be asked to test your knowledge by completing quizzes. The quizzes are not graded and are meant to help you review what you have learned. At the end of each module you will be required to pass a module exam before you are allowed to continue. Course navigation:</p>\n<p>Each page of the course contains navigation buttons at the bottom of the page which allow you to navigate both forwards and backwards through the course.</p>\n<p><span style=\"font-size: 18pt;\"><strong>Course Table of Contents:</strong></span></p>\n<p>At any point in the course you may click on the Table of Contents link at the top of each page. You can quickly navigate to any part of the course by selecting the subject shown (Note: You will not be able to advance to sections of the course that you have not yet completed).</p>\n<p><span style=\"font-size: 18pt;\"><strong>Signing In and Out of the Course:</strong></span></p>\n<p>At any point in the course you may sign out by closing your browser or clicking on the links to return to the \"My Courses\" page. We will record your progress so that when you return and resume the course you will begin where you left off. To resume the course 1) sign in using the email and password you entered during your purchase and registration, then 2) navigate to the \"My Courses\" area (link at the top of the page), and 3) click \"Resume\" for the selected course.</p>','null','contents_body_html',4,20,'1694538978',NULL,'44594',NULL,'','2024-02-10 15:43:11.080294'),(47511,'<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>ABOUT THIS COURSE</strong></span></h1>\n<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>Course Curriculum:</strong></span></h1>\n<pre style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">This course is broken down into 12 modules. Each module contains various related subjects. Throughout the course you will be asked to test your knowledge by completing quizzes. The quizzes are not graded and are meant to help you review what you have learned. At the end of each module you will be required to pass a module exam before you are allowed to continue. Course navigation:</span></pre>\n<pre style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">Each page of the course contains navigation buttons at the bottom of the page which allow you to navigate both forwards and backwards through the course.</span></pre>\n<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>Course Table of Contents:</strong></span></h1>\n<pre style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">At any point in the course you may click on the Table of Contents link at the top of each page. You can quickly navigate to any part of the course by selecting the subject shown (Note: You will not be able to advance to sections of the course that you have not yet completed).</span></pre>\n<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>Signing In and Out of the Course:</strong></span></h1>\n<pre style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">At any point in the course you may sign out by closing your browser or clicking on the links to return to the \"My Courses\" page. We will record your progress so that when you return and resume the course you will begin where you left off. To resume the course 1) sign in using the email and password you entered during your purchase and registration, then 2) navigate to the \"My Courses\" area (link at the top of the page), and 3) click \"Resume\" for the selected course.</span></pre>','null','contents_body_html_mobile',5,20,'1694538978',NULL,'44594',NULL,'','2024-02-10 15:43:11.080294'),(47512,'Discription','null','contents_type',2,20,'1694538978',NULL,'44594',NULL,'','2024-02-10 15:43:11.080294'),(47513,'ABOUT THIS COURSE\nCourse Curriculum:\nThis course is broken down into 12 modules. Each module contains various related subjects. Throughout the course you will be asked to test your knowledge by completing quizzes. The quizzes are not graded and are meant to help you review what you have learned. At the end of each module you will be required to pass a module exam before you are allowed to continue. Course navigation:\nEach page of the course contains navigation buttons at the bottom of the page which allow you to navigate both forwards and backwards through the course.\nCourse Table of Contents:\nAt any point in the course you may click on the Table of Contents link at the top of each page. You can quickly navigate to any part of the course by selecting the subject shown (Note: You will not be able to advance to sections of the course that you have not yet completed).\nSigning In and Out of the Course:\nAt any point in the course you may sign out by closing your browser or clicking on the links to return to the \"My Courses\" page. We will record your progress so that when you return and resume the course you will begin where you left off. To resume the course 1) sign in using the email and password you entered during your purchase and registration, then 2) navigate to the \"My Courses\" area (link at the top of the page), and 3) click \"Resume\" for the selected course.','null','contents_body',1,20,'1694538978',NULL,'44594',NULL,'','2024-02-10 15:43:11.080294'),(47514,'IT\'S TIME TO ORDER THE PARENT TAUGHT DRIVER EDUCATION PROGRAM GUIDE\nIMPORTANT!If you want to get your permit IT\'S VERY IMPORTANT that you don\'t miss one of the biggest steps toward getting it. If you or your parents have not requested the Parent Taught Driver Education (PTDE) Program Guide from the Texas Department of Licensing and Regulation (TDLR) yet, you need to do this now!You can order the Parent Taught Driver Education Program Guide online here:https://www.tdir.texas.gov/parenttaught/PTSelect.aspxWhen you submit your form online, TDLR will send a PTDE Program Guide back to you-by mail or email, whichever you choose. By email will be significantly faster. The TDLR charges $20 for the program guide and you can pay with a credit or debit card. The $20 goes to TDLR and is not a fee that we charge.Please keep in mind that ordering the PTDE Program Guide does not automatically make a parent eligible to be the instructor. For full requirements and additional information please visit the official TDLR information page below:https://www.tdir.texas.gov/driver/parenttaughtprogram.htm\nWhy Should You Do This?\nThe program guide will provide you with the forms and logs you\'ll need in order to get your permit and your license. In addition, it\'s required by the state. You cannot get your permit or license if you don\'t have your program guide. You should not start the course without first getting your PTDE Program Guide.Please confirm that you have ordered the PTDE Program Guide from TDLR before you proceed. The DPS will require you to bring your program guide receipt when you go to get your permit and will not issue a permit without it.Problem on this page? Click here to let us know.','null','contents_body',1,20,'1694539044',NULL,'44596',NULL,'','2024-02-10 15:43:11.080294'),(47515,'','null','image_url',3,20,'1694539044',NULL,'44596',NULL,'','2024-02-10 15:43:11.080294'),(47516,'<p><span style=\"font-size: 18pt;\"><strong>IT\'S TIME TO ORDER THE PARENT TAUGHT DRIVER EDUCATION PROGRAM GUIDE</strong></span></p>\n<p>IMPORTANT!</p>\n<p>If you want to get your permit IT\'S VERY IMPORTANT that you don\'t miss one of the biggest steps toward getting it. If you or your parents have not requested the Parent Taught Driver Education (PTDE) Program Guide from the Texas Department of Licensing and Regulation (TDLR) yet, you need to do this now!<br>You can order the Parent Taught Driver Education Program Guide online here:<br>https://www.tdir.texas.gov/parenttaught/PTSelect.aspx</p>\n<p>When you submit your form online, TDLR will send a PTDE Program Guide back to you-by mail or email, whichever you choose. By email will be significantly faster. The TDLR charges $20 for the program guide and you can pay with a credit or debit card. The $20 goes to TDLR and is not a fee that we charge.<br>Please keep in mind that ordering the PTDE Program Guide does not automatically make a parent eligible to be the instructor. For full requirements and additional information please visit the official TDLR information page below:<br>https://www.tdir.texas.gov/driver/parenttaughtprogram.htm</p>\n<p><strong><span style=\"font-size: 18pt;\">Why Should You Do This?</span></strong></p>\n<p>The program guide will provide you with the forms and logs you\'ll need in order to get your permit and your license. In addition, it\'s required by the state. You cannot get your permit or license if you don\'t have your program guide. You should not start the course without first getting your PTDE Program Guide.<br>Please confirm that you have ordered the PTDE Program Guide from TDLR before you proceed. The DPS will require you to bring your program guide receipt when you go to get your permit and will not issue a permit without it.<br>Problem on this page? Click here to let us know.</p>','null','contents_body_html',4,20,'1694539044',NULL,'44596',NULL,'','2024-02-10 15:43:11.080294'),(47517,'<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>IT\'S TIME TO ORDER THE PARENT TAUGHT DRIVER EDUCATION PROGRAM GUIDE</strong></span></h1>\n<pre style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">IMPORTANT!</span><br><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">If you want to get your permit IT\'S VERY IMPORTANT that you don\'t miss one of the biggest steps toward getting it. If you or your parents have not requested the Parent Taught Driver Education (PTDE) Program Guide from the Texas Department of Licensing and Regulation (TDLR) yet, you need to do this now!</span><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">You can order the Parent Taught Driver Education Program Guide online here:</span><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">https://www.tdir.texas.gov/parenttaught/PTSelect.aspx</span><br><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">When you submit your form online, TDLR will send a PTDE Program Guide back to you-by mail or email, whichever you choose. By email will be significantly faster. The TDLR charges $20 for the program guide and you can pay with a credit or debit card. The $20 goes to TDLR and is not a fee that we charge.</span><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">Please keep in mind that ordering the PTDE Program Guide does not automatically make a parent eligible to be the instructor. For full requirements and additional information please visit the official TDLR information page below:</span><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">https://www.tdir.texas.gov/driver/parenttaughtprogram.htm</span></pre>\n<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 14pt; color: rgb(236, 240, 241);\"><strong>Why Should You Do This?</strong></span></h1>\n<pre style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">The program guide will provide you with the forms and logs you\'ll need in order to get your permit and your license. In addition, it\'s required by the state. You cannot get your permit or license if you don\'t have your program guide. You should not start the course without first getting your PTDE Program Guide.</span><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">Please confirm that you have ordered the PTDE Program Guide from TDLR before you proceed. The DPS will require you to bring your program guide receipt when you go to get your permit and will not issue a permit without it.</span><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">Problem on this page? Click here to let us know.</span></pre>','null','contents_body_html_mobile',5,20,'1694539044',NULL,'44596',NULL,'','2024-02-10 15:43:11.080294'),(47518,'Discription','null','contents_type',2,20,'1694539044',NULL,'44596',NULL,'','2024-02-10 15:43:11.080294'),(47519,'<p><span style=\"font-size: 18pt;\"><strong>Module 1: Traffic Laws&nbsp;</strong></span></p>\n<p><strong><span style=\"font-size: 18pt;\">Subject 1: Introduction</span></strong></p>\n<p>TOPIC A: Recognize how Texas Driver Education and Traffic Safety Program provides a novice driver the foundation of knowledge, understanding, skills, and experiences necessary for the novice driver and the parent, guardian, or adult mentor to continue the lifelong learning process of reduced-risk driving in the Highway Transportation System.<br>What are the benefits of this course?</p>\n<p>If you were having problems with your phone and you wanted to diagnose and fix it you would consult the owner\'s manual, or even the manufacturer, because the best source for information about a product is from the maker. You want your phone to last for a long time, and you want it to operate smoothly while you\'re using it. Likewise, driving in the state of Texas is best guided by the Texas Driver Education and Traffic Safety Program. No one knows the roads, rules, systems, and history better. How beneficial it is to take advantage of the expertise available!<br>Problem on this page? Click here to let us know.</p>','null','contents_body_html',4,20,'1694539089',NULL,'44601',NULL,'','2024-02-10 15:43:11.080294'),(47520,'<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>Module 1: Traffic Laws&nbsp;</strong></span></h1>\n<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 14pt; color: rgb(236, 240, 241);\"><strong>Subject 1: Introduction</strong></span></h1>\n<pre><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">