d-risk driving practices in the HTS. What does all of this have to do with driving?</p>\n<p><br>The Texas Department of Public Safety maintains the records of 13.4 million drivers on a yearly basis.<br>Out of the 26.4 million people that lived in Texas in 2013 there were 3,382 people who died due to a fatal car crash. What does this have to do with you? You too will be driving one of those vehicles. That is a privilege that comes with great responsibility.</p>','null','contents_body_html',4,20,'1694539607',NULL,'44611',NULL,'','2024-02-10 15:43:11.080294'),(47545,'<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>Subject 1: Introduction</strong></span></h1>\n<pre style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">Topic E: Know the importance of formulating and sustaining a Driving Plan that provides novice drivers the foundation of knowledge, understanding, skills, and experiences necessary for the novice driver and parent, guardian, or adult member to launch and continue the life-long learning process of legal and responsible reduced-risk driving practices in the HTS. What does all of this have to do with driving?</span><br><br><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">The Texas Department of Public Safety maintains the records of 13.4 million drivers on a yearly basis.</span><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">Out of the 26.4 million people that lived in Texas in 2013 there were 3,382 people who died due to a fatal car crash. What does this have to do with you? You too will be driving one of those vehicles. That is a privilege that comes with great responsibility.</span></pre>','null','contents_body_html_mobile',5,20,'1694539607',NULL,'44611',NULL,'','2024-02-10 15:43:11.080294'),(47546,'Subject 1: Introduction\nTopic E: Know the importance of formulating and sustaining a Driving Plan that provides novice drivers the foundation of knowledge, understanding, skills, and experiences necessary for the novice driver and parent, guardian, or adult member to launch and continue the life-long learning process of legal and responsible reduced-risk driving practices in the HTS. What does all of this have to do with driving?The Texas Department of Public Safety maintains the records of 13.4 million drivers on a yearly basis.Out of the 26.4 million people that lived in Texas in 2013 there were 3,382 people who died due to a fatal car crash. What does this have to do with you? You too will be driving one of those vehicles. That is a privilege that comes with great responsibility.','null','contents_body',1,20,'1694539607',NULL,'44611',NULL,'','2024-02-10 15:43:11.080294'),(47547,'','null','image_url',3,20,'1694539607',NULL,'44611',NULL,'','2024-02-10 15:43:11.080294'),(47548,'Discription','null','contents_type',2,20,'1694539607',NULL,'44611',NULL,'','2024-02-10 15:43:11.080294'),(47549,'Module 1: Traffic Laws\nSubject 2: Your license to drive\nTopic A: Describe the process, responsibility, and obligation of obtaining, possessing, and renewing a Texas driver license including the instruction permit.\nHow do I get a driver license?\nObtaining a driver license is undoubtedly an exciting milestone for many teen drivers. Perhaps you have been waiting for this moment since you learned what a car was. Or, maybe just thinking of getting behind the wheel of a car makes you nervous.Individuals under the age of 18 who wish to obtain a Texas driver license must take part in the Texas Graduated Driver License Program (GDL). The GDL was established in an effort to minimize risks associated with first time drivers and requires the completion of certain stages or phases.\nPhase 1: Learner License\nComplete an approved driver education course consisting of 32 hours of classroom instruction and an additional 30 hours of behind the wheel training before applying for a driver license.Take and pass a written test in order to receive a Learner License. Note: Before receiving the Learner License teens under the age of 18 will need to submit verification of attendance and enrollment in school, a valid high school diploma or a State of Texas certificate of completion equivalent and will also need to pass a vision-screening test.A Learner License allows a non-licensed driver to gain driving experience driving before obtaining a provisional license.A Learner License requires that a licensed adult 21 years of age or older occupies the front passenger seat when a person with a Learner License is driving.','null','contents_body',1,20,'1694539688',NULL,'44613',NULL,'','2024-02-10 15:43:11.080294'),(47550,'','null','image_url',3,20,'1694539688',NULL,'44613',NULL,'','2024-02-10 15:43:11.080294'),(47551,'<p><span style=\"font-size: 18pt;\"><strong>Module 1: Traffic Laws</strong></span></p>\n<p><strong><span style=\"font-size: 18pt;\">Subject 2: Your license to drive</span></strong></p>\n<p>Topic A: Describe the process, responsibility, and obligation of obtaining, possessing, and renewing a Texas driver license including the instruction permit.</p>\n<p><span style=\"font-size: 18pt;\"><strong>How do I get a driver license?</strong></span></p>\n<p>Obtaining a driver license is undoubtedly an exciting milestone for many teen drivers. Perhaps you have been waiting for this moment since you learned what a car was. Or, maybe just thinking of getting behind the wheel of a car makes you nervous.<br>Individuals under the age of 18 who wish to obtain a Texas driver license must take part in the Texas Graduated Driver License Program (GDL). The GDL was established in an effort to minimize risks associated with first time drivers and requires the completion of certain stages or phases.</p>\n<p><strong><span style=\"font-size: 18pt;\">Phase 1: Learner License</span></strong></p>\n<p>Complete an approved driver education course consisting of 32 hours of classroom instruction and an additional 30 hours of behind the wheel training before applying for a driver license.</p>\n<p>Take and pass a written test in order to receive a Learner License. Note: Before receiving the Learner License teens under the age of 18 will need to submit verification of attendance and enrollment in school, a valid high school diploma or a State of Texas certificate of completion equivalent and will also need to pass a vision-screening test.</p>\n<p>A Learner License allows a non-licensed driver to gain driving experience driving before obtaining a provisional license.&nbsp;</p>\n<p>A Learner License requires that a licensed adult 21 years of age or older occupies the front passenger seat when a person with a Learner License is driving.</p>','null','contents_body_html',4,20,'1694539688',NULL,'44613',NULL,'','2024-02-10 15:43:11.080294'),(47552,'<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>Module 1: Traffic Laws</strong></span></h1>\n<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 14pt; color: rgb(236, 240, 241);\"><strong>Subject 2: Your license to drive</strong></span></h1>\n<pre style=\"text-align: left; line-height: 2;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">Topic A: Describe the process, responsibility, and obligation of obtaining, possessing, and renewing a Texas driver license including the instruction permit.</span></pre>\n<h1 style=\"text-align: left; line-height: 2;\"><span style=\"font-size: 14pt; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\"><strong>How do I get a driver license?</strong></span></h1>\n<pre style=\"text-alig