se.&nbsp;</span><br><br><span style=\"font-family: tahoma, arial, helvetica, sans-serif; color: rgb(236, 240, 241);\">A Learner License requires that a licensed adult 21 years of age or older occupies the front passenger seat when a person with a Learner License is driving.</span></pre>','null','contents_body_html_mobile',5,20,'1694539688',NULL,'44613',NULL,'','2024-02-10 15:43:11.080294'),(47553,'Discription','null','contents_type',2,20,'1694539688',NULL,'44613',NULL,'','2024-02-10 15:43:11.080294'),(47554,'4 week','null','course_length',3,18,'1694619209',NULL,'lalchan123',NULL,'','2024-02-10 15:43:11.080294'),(47555,'Lalchan mentor course for programming detials in here update','null','course_info _dtl',2,18,'1694619209',NULL,'lalchan123',NULL,'','2024-02-10 15:43:11.080294'),(47556,'50','null','course_discount_price',5,18,'1694619209',NULL,'lalchan123',NULL,'','2024-02-10 15:43:11.080294'),(47557,'60','null','course_previous_price',6,18,'1694619209',NULL,'lalchan123',NULL,'','2024-02-10 15:43:11.080294'),(47558,'Lalchan mentor course for programming ','null','course_name',1,18,'1694619209',NULL,'lalchan123',NULL,'','2024-02-10 15:43:11.080294'),(47559,'47558','null','course_id',4,18,'1694619209',NULL,'lalchan123',NULL,'','2024-02-10 15:43:11.080294'),(47560,'1','null','course_slno',3,19,'1694619555',NULL,'47558',NULL,'','2024-02-10 15:43:11.080294'),(47561,'chapter one','null','ccon_desc_title',1,19,'1694619555',NULL,'47558',NULL,'','2024-02-10 15:43:11.080294'),(47562,'2','null','course_slno',3,19,'1694619556',NULL,'47558',NULL,'','2024-02-10 15:43:11.080294'),(47563,'chapter','null','content_type',4,19,'1694619556',NULL,'47558',NULL,'','2024-02-10 15:43:11.080294'),(47564,'chapter','null','content_type',4,19,'1',NULL,'47558',NULL,'','2024-02-10 15:43:11.080294'),(47565,'chapter two','null','ccon_desc_sub_title',2,19,'1694619556',NULL,'47558',NULL,'','2024-02-10 15:43:11.080294'),(47566,'Arbitrary values If you need to use a one-off border-radius value that does